import React from 'react';

export class Signup extends React.Component {

    constructor(props) {
        super(props);
    };

    render() {
        return (
            <div className="base-container">
                <div className="header">Signup</div>
                <div className="content">
                    <div className="imagen">
                        <img src={logo}/>
                    </div>
                    <div className="form">
                    <div className="form-group">
                            <label htmlFor="Correo">Nombres</label>
                            <input type="text" name="nombres" placeholders="Nombres"/>
                        </div>
                        <div className="form-group">
                            <label htmlFor="Correo">Apellidos</label>
                            <input type="text" name="apellidos" placeholders="Apellidos"/>
                        </div>
                        <div className="form-group">
                            <label htmlFor="Correo">Identificacion</label>
                            <input type="text" name="identificacion" placeholders="Identificacion"/>
                        </div>
                        <div className="form-group">
                            <label htmlFor="Correo">Correo</label>
                            <input type="email" name="correo" placeholders="Correo"/>
                        </div>
                        <div className="form-group">
                            <label htmlFor="contraseña">Contraseña</label>
                            <input type="password" name="contraseña" placeholders="Correo"/>
                        </div>
                    </div>
                </div>
                <div className="footer">
                    <button type="button" className="btn">Signup</button>
                </div>
            </div>
        );
    };
};
